    // var line_resp1 = 100
    const line_resp1 = this.state.value8;
    console.log(line_resp1)
    var parameter = 0.1

    let parameters = mathLib.linspacee(0, 1, line_resp1, 0)
    console.log(parameters)

    let alpha = 0.025464790894703267 - 0.016976527263135505*Math.cos((4*Math.PI*parameter)) - 0.0033953054526271037*Math.cos(8*Math.PI*parameter) 
          - 0.040000000000000036*Math.sin((2*Math.PI*parameter)) + 2.7305908429669844e-18*Math.sin((4*Math.PI*parameter)) - 1.734723475976807e-18*Math.sin((6*Math.PI*parameter))
          - 1.843267981421152e-18*Math.sin((8*Math.PI*parameter)) + 8.673617379884035e-19*Math.sin((10*Math.PI*parameter))

    let epsilon =  0.5000000000000006 - 0.4526423672846763*Math.cos(2*parameter*Math.PI) + 7.01943515742626e-17*Math.cos(4*parameter*Math.PI) - 0.022515818587186147*Math.cos(6*parameter*Math.PI) - 
         3.0014068312294517e-16*Math.cos(8*parameter*Math.PI) - 0.008105694691387139*Math.cos(10*parameter*Math.PI) - 1.6653345369377348e-16*Math.sin(2*parameter*Math.PI) + 
         0.053051647697298504*Math.sin(4*parameter*Math.PI) + 1.6653345369377348e-16*Math.sin(6*parameter*Math.PI) + 0.0053051647697298365*Math.sin(8*parameter*Math.PI) - 
         2.220446049250313e-16*Math.sin(10*parameter*Math.PI);

    this.setState({ alpha, epsilon });
