            <td>...</td>
            <td>...</td>
          </tr>
        </tbody>
      </table>



      <div className="Div"></div>

      <div className="button compute">
        { this.state.showContainers? <Containers /> : null }
        <button onClick={() => this.add()}>COMPUTE</button>
      </div>

      <div className="Div"></div>

       <table className="user" >
        <thead>
          <tr> 
            <th><b>line_resp1</b></th>
            <th><b>c0</b></th> 
            <th><b>c1</b></th> 
            <th><b>c2</b></th>
